import React, { Component } from 'react';
import {Apps ,Container,MainTitle,BtnToggle,BtnChange} from './style';


import StatesPrice from './StatesPrice';

class App extends Component {
	state = {
		textflag: false
	};
	ToggleButton() {
		this.setState({ textflag: !this.state.textflag });
	}
	render() {
	
		return (
			<Apps>
				<Container>
					<MainTitle>Our Pricing</MainTitle>
					<BtnToggle>
						<span>Annually</span>
						<BtnChange onClick={() => this.ToggleButton()}  />

						
						
					</BtnToggle>
					
					<StatesPrice />
				</Container>
			</Apps>
		);
	}
}

export default App;
